import './App.css';
import { useState } from 'react';

function App() {
  // Variables
  const [count, setCount] = useState(0);

  function handleClick() {
    setCount(count + 1);
  }

  function MyButton() {
    return (
      <>
        <button count={count} onClick={handleClick}>You have clicked me {count}</button>
      </>
    )
  }
  function Reset() {
    return(
      <>
      <br></br>
      <button onClick={() => setCount(0)}>Reset</button>
      </>
    )
  }


  // html
  return (
    <div className="App">
      <header className="App-header">
          <h1>hi</h1>
          <MyButton/>
          <Reset />
      </header>
    </div>
  );
}


export default App;
